import React from "react";
import './index.css'
function Card(props) {
    return (
        <div>
            
            <div className="card">
                <div className="top">
                    <h2 className="name">{props.name}</h2>
                    <img className="circle-img" src={props.img} alt="Avatar_img"></img>
                </div>
                <div className="bottom">
                    <p className="info">{props.phone}</p>
                    <p>{props.email}</p>
                </div>
                
            </div>
            
        </div>
    )
}
export default Card;
